// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import {AddUser} from "./AddUsers.sol";

contract UserInsuranceClaim is AddUser {

    struct Claim {
        uint claimId;
        address user;
        uint insuranceNo;
        string reason;
        uint amount;
        string status; // "Pending", "Approved", "Rejected"
    }

    uint public claimCount = 0;
    mapping(uint => Claim) public claims;
    mapping(address => uint[]) public userClaims;

    event ClaimRequested(uint indexed claimId, address indexed user, uint insuranceNo, uint amount, string reason);
    event ClaimUpdated(uint indexed claimId, string status);

    function requestClaim(string memory _reason, uint _insuranceNo, uint _amount) public {
        require(myUsers[msg.sender].userId != 0, "User not registered");

        claimCount += 1;

        claims[claimCount] = Claim({
            claimId: claimCount,
            user: msg.sender,
            insuranceNo: _insuranceNo,
            reason: _reason,
            amount: _amount,
            status: "Pending"
        });

        userClaims[msg.sender].push(claimCount);

        emit ClaimRequested(claimCount, msg.sender, _insuranceNo, _amount, _reason);
    }

    function updateClaimStatus(uint _claimId, string memory _status) public onlyOwner {
        require(_claimId > 0 && _claimId <= claimCount, "Invalid claim ID");
        require(
            keccak256(bytes(_status)) == keccak256(bytes("Approved")) ||
            keccak256(bytes(_status)) == keccak256(bytes("Rejected")),
            "Invalid status"
        );

        claims[_claimId].status = _status;

        emit ClaimUpdated(_claimId, _status);
    }

    function getMyClaims() public view returns (uint[] memory) {
        return userClaims[msg.sender];
    }

    function getClaimDetails(uint _claimId) public view returns (Claim memory) {
        return claims[_claimId];
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract AddUser {
    
    address public owner;

    struct User {   
        int userId; 
        string name;
        int insuranceNo;
        address userAddress;
    }
        
    mapping (address => int) private userInsuranceCount; 
    mapping (address => int[]) private userInsuranceNumbers;

    int public userCount = 0;

    constructor() {
        owner = msg.sender;
    }

    mapping (address => User) public myUsers;

    modifier onlyOwner {
        require(owner == msg.sender, "Only Owner has access to this function");
        _;
    }

    event UserAdded(address indexed user, int userId, string name, int insuranceNo);
    event InsuranceAdded(address indexed user, int insuranceNo);

    function addUser(string memory _name, int _insuranceNo) public {
        require(myUsers[msg.sender].userId == 0, "User already exists");

        userCount += 1;
        myUsers[msg.sender] = User({
            userId: userCount,
            name: _name,
            insuranceNo: _insuranceNo,
            userAddress: msg.sender            
        });
        
        userInsuranceNumbers[msg.sender].push(_insuranceNo);
        userInsuranceCount[msg.sender]++;

        emit UserAdded(msg.sender, userCount, _name, _insuranceNo);
    }

    function getUser() public view returns (User memory) {        
        return myUsers[msg.sender];
    }

    function getInsuranceCount(address _user) public view onlyOwner returns (int) {
        return userInsuranceCount[_user];
    }

    function getInsuranceNumber(address _user) public view onlyOwner returns (int[] memory) {
        return userInsuranceNumbers[_user];
    }

    function myInsuranceNumbers() public view returns (int[] memory) {
        return userInsuranceNumbers[msg.sender];
    }

    function addNewInsurance(int _insuranceNo) public {
        require(myUsers[msg.sender].userId != 0, "User not registered");
        
        userInsuranceNumbers[msg.sender].push(_insuranceNo);
        userInsuranceCount[msg.sender]++;
        emit InsuranceAdded(msg.sender, _insuranceNo);
    }
}

